const express = require('express');
const cors = require('cors');
const bodyParser = require('body-parser');
const { D1Client } = require('@cloudflare/d1');

const { checkProof } = require('./api/check-proof');
const { createJetton } = require('./api/create-jetton');
const { generatePayload } = require('./api/generate-payload');
const { getAccountInfo } = require('./api/get-account-info');
const { healthz } = require('./api/healthz');

const app = express();

const allowedDomains = ['https://naton.space', 'https://anotherdomain.com'];

const corsOptions = {
  origin: function (origin, callback) {
    if (allowedDomains.indexOf(origin) !== -1 || !origin) {
      callback(null, true);
    } else {
      callback(new Error('Not allowed by CORS'));
    }
  }
};

app.use(cors(corsOptions));
app.use(bodyParser.json());

const d1 = new D1Client({
  databaseId: 'BD_bot'
});

app.use((req, res, next) => {
  req.db = d1;
  next();
});

app.post('/api/check_proof', checkProof);
app.post('/api/create_jetton', createJetton);
app.post('/api/generate_payload', generatePayload);
app.get('/api/get_account_info', getAccountInfo);
app.get('/api/healthz', healthz);

const PORT = process.env.PORT || 3000;
app.listen(PORT, () => {
  console.log(`Server is running on port ${PORT}`);
});
